import { AuthenticatedTemplate, UnauthenticatedTemplate } from '@azure/msal-react';
import './App.css';
import { ReqUsers } from './components/DataCollection/ReqUsers';
import { GetUsers } from './components/DataCollection/ReqUsers';

function App() {
  return (
    <div className="App">
      <AuthenticatedTemplate>
        <h1>Ur Logged In!</h1>
        <GetUsers />
      </AuthenticatedTemplate>
      <UnauthenticatedTemplate>
        <ReqUsers/>
      </UnauthenticatedTemplate>
    </div>
  );
}

export default App;
